import './App.css';
import axios from 'axios';

axios.defaults.withCredentials = true;

axios({
  method: 'post',
  url: 'https://11c3-49-143-68-94.ngrok-free.app/member',
  data: {
    name: '김성1수',
    email: 'maekj11f1k',
  },
})
  .then(function (data) {
    console.log(data);
  })
  .catch(function (error) {
    console.log(error);
  });

function App() {
  return (
    <>
      <button
        onClick={() => {
          axios
            .get('https://11c3-49-143-68-94.ngrok-free.app/member/1', {
              withCredentials: true, // withCredentials 옵션 추가
            })
            .then((response) => {
              console.log(response);
            })
            .catch((error) => {
              console.error(error);
            });
        }}
      >
        데이터 받아오기
      </button>
    </>
  );
}

export default App;
